import React from 'react';
import {useLocation} from 'react-router-dom'

export default function CostumerDetails(props) {

    const location = useLocation();
    const { costumerData } = location.state;

    return (
      <div style={{backgroundColor : 'gray',marginRight:'500px'}}>
        <p style={{ border: "2px solid blue", width: "100px", color: "white" }}>
          {costumerData.name}
        </p>
        <p style={{ border: "2px solid blue", width: "100px", color: "white" }}>
          {costumerData.id}
        </p>
        <p style={{ border: "2px solid blue", width: "100px", color: "white" }}>
          {costumerData.address}
        </p>
        <p style={{ border: "2px solid blue", width: "100px", color: "white" }}>
          {costumerData.phoneNumber}
        </p>
        <p style={{ border: "2px solid blue", width: "100px", color: "white" }}>
          {costumerData.plateNumber}
        </p>
      </div>
    );
}
